import './Chessboard.css';
import { Pawn } from '../pieces/Pawn';
import { Rook } from '../pieces/Rook';
import { PieceModel } from '../../../../model/PieceModel';
import { SquareModel } from '../../../../model/SquareModel';

export default function Square(props: {squareModel: SquareModel} /*{color:string, pos:string, piece:PieceModel | undefined}*/){
    const squareModel:SquareModel = props.squareModel;
    const piece = squareModel.getPiece();
    let pieceView = undefined;
    if(piece?.getType() == "Pawn"){
        pieceView = <Pawn type="Pawn" color={piece.getColor()}></Pawn>
    }
    else if(piece?.getType() == "Rook"){
        pieceView = <Rook type="Rook" color={piece.getColor()}></Rook>
    }

    return (<div className={squareModel.getColor()+"Square"} id={squareModel.getPos()}>
                {squareModel.getPos()}
            </div>);
}
